import NavApp from "./AppHTML/NavApp";
import concertInformation from "../AppApi/concertInformation";

import { HashRouter, Routes, Route } from "react-router-dom";


function MainApp() {
  return (
    <main className="MainApp">
      <HashRouter>
      <NavApp />
      <Routes>
        <Route exact path="/" element={<concertInformation/>} />
        <Route path="/post" element={<ApiPost />} />
        <Route path="/delete" element={<ApiDelete />} />
        <Route path="/put" element={<ApiPut />} />

      </Routes>
    </HashRouter>
    </main>
  );
};

export default MainApp;
